GlobalParameters:
  MinimumRequiredVersion: 4.4.0
  PrintLevel: 1
  # ForceRedoBenchmarkProblems: True
  # ForceRedoLibraryLogic: True
  # ForceRedoLibraryClient: True
  CMakeBuildType: Release
  EnqueuesPerSync: 1
  SyncsPerBenchmark: 1
  LibraryPrintDebug: False
  # NumElementsToValidate: -1
  NumElementsToValidate: 16384
  ValidationMaxToPrint: 4
  ValidationPrintValids: False
  ShortNames: False
  MergeFiles: True
  Platform: 0
  Device: 0
  KernelTime: True
  # PinClocks: True
  SleepPercent: 200
  PrintSolutionRejectionReason: False
  # EnableAsserts: True
  # EnableDebugA: True
  # EnableDebugB: True
  # DataInitTypeA: 1
  # DataInitTypeB: 1
  # DataInitTypeC: 0
  # DataInitTypeD: 0
  DataInitTypeBeta: 0
  DataInitTypeAlpha: 1
  # PrintTensorA: 1
  # PrintTensorB: 1
  # PrintTensorC: 2
  # PrintTensorRef: 2
  NewClient: 2
  CSVExportWinner: True
  CSVMergeSameProblemID: True

BenchmarkProblems:
  ########################################
  # All MT Combination - NN
  ########################################
  -
    - # ProblemType - NN
      OperationType: GEMM
      #####################################
      DataType: I8
      DestDataType: I
      HighPrecisionAccumulate: True
      #####################################
      TransposeA: False
      TransposeB: False
      UseBeta: True
      Batched: True

    - # BenchmarkProblemSizeGroup - Standard
      InitialSolutionParameters:
      BenchmarkCommonParameters:
        - KernelLanguage: ["Assembly"]
        - LoopTail: [True]
        - PrefetchGlobalRead: [True]
        - PrefetchLocalRead: [True]
        - OptNoLoadLoop: [True]
        - ExpandPointerSwap: [True]
        - EdgeType: ["ShiftPtr"]
        # - ScheduleGlobalRead: [True] # default
        # - ScheduleLocalWrite: [True] # default
      ForkParameters:
        - MatrixInstruction:
          - [ 4, 4, 4,16, 2, 1,1, 2,2]  # 16x64
          - [ 4, 4, 4,16, 2, 2,2, 2,2]  # 32x128

          - [16,16, 4, 4, 1, 1,1, 2,2]  # 32x128
          - [16,16, 4, 4, 1, 2,2, 2,2]  # 64x256

          - [16,16,16, 1, 1, 1,1, 2,2]  # 32x32
          - [16,16,16, 1, 1, 2,2, 2,2]  # 64x64

          - [32,32, 4, 2, 1, 1,1, 2,2]  # 64x128
          - [32,32, 4, 2, 1, 2,2, 2,2]  # 128x256

          - [32,32, 8, 1, 1, 1,1, 2,2]  # 64x64
          - [32,32, 8, 1, 1, 2,2, 2,2]  # 128x128

          - [32,32, 8, 1, 1, 1,4, 4,2]  # 128x256
        - ThreadTile:
          - [ 4, 4 ]
        - WorkGroup:
          - [ 16, 16, 1 ]
        - AssertFree0ElementMultiple: [1,4]
        - DepthU: [ 16,32,64 ]
        # - VectorWidth: [4]
        - WaveSeparateGlobalReadA: [1] # priority 1
        - WaveSeparateGlobalReadB: [1]
        - TransposeLDS: [True]         # priority 2 (Done)
        - StoreRemapVectorWidth: [0,4]  # priority 3
        - ScheduleIterAlg: [3]          # priority 4 --> SIA3
        # - InnerUnroll: [2]             # TBD
        - PersistentKernel: [-1,0]                  # priority 5 (Done)
        - PersistentKernelAlongBatch: [False,True]  # priority 5 (Done)
        - PrefetchAcrossPersistent: [False,True]    # priority 5 (Done)
